;; gorilla-repl.fileformat = 1

;; **
;;; # Tennis Ball
;;; 
;;; This tutorial proposes options to find a tennis ball in a picture.
;; **

;; @@
(ns divine-briars
  (:require
    [opencv3.utils :as u]
    [opencv3.colors.rgb :as color]
    [opencv3.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; First, let's load the image that will be the base for our image finding exercice.
;; **

;; @@
(def img (-> "http://i.imgur.com/uoNRu60.jpg" (u/mat-from-url) (u/resize-by 0.5)))
(u/mat-view img)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x211f640f \"BufferedImage@211f640f: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Using Hough Circles
;; **

;; @@
(def hsv (-> img clone (cvt-color! COLOR_RGB2HSV)))
(def thresh-image (new-mat))
(in-range hsv (new-scalar 50 100 0) (new-scalar 95 255 255) thresh-image)

; the ball is here
(u/mat-view thresh-image)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6754829d \"BufferedImage@6754829d: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(let[ circles (new-mat) output (clone img) minRadius 25 maxRadius 40 ]
      
(hough-circles thresh-image circles CV_HOUGH_GRADIENT 1 minRadius 120 15 minRadius maxRadius)

(dotimes [i (.cols circles)]
  (let [ circle (.get circles 0 i) x (nth circle 0) y (nth circle 1) r (nth circle 2)  p (new-point x y)]
  (opencv3.core/circle output p (int r) color/plum 2)))

; the ball is detected
(u/mat-view output))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xf042ad1 \"BufferedImage@f042ad1: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Method2: Using Find Contours
;; **

;; @@
(let[ hsv (-> img clone (cvt-color! COLOR_RGB2HSV))
	  thresh-image (new-mat)
      contours (new-arraylist)
      output (clone img)]
  
(in-range hsv 
          (new-scalar 50 100 0) 
          (new-scalar 95 255 255) 
          thresh-image)
  
(find-contours 
  thresh-image 
  contours 
  (new-mat)  ; mask
  RETR_LIST 
  CHAIN_APPROX_SIMPLE)
  
(dotimes [ci (.size contours)]
 (if (> (contour-area (.get contours ci)) 100 )
  (draw-contours output contours ci color/plum 2)))
  
(u/mat-view output))
